import React from 'react';
import Jumbotron from 'react-bootstrap/Jumbotron';

function Hero() {

    return(
        <Jumbotron>
            <Container>
                <Row>
                    <Col>
                        <h2> hellooo</h2>
                    </Col>
                </Row>
            </Container>
        </Jumbotron>
    );
}

export default Hero;
